en.value:
&lt;p&gt;Read the given statements and conclusions carefully. Assuming that the information given in the statements is true, even if it appears to be at variance with commonly known facts, decide which of the given conclusions logically follow(s) from the statements.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Statements:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;All polygons are angles.&lt;/p&gt;

&lt;p&gt;All angles are diagonals.&lt;/p&gt;

&lt;p&gt;All cones are cubes.&lt;/p&gt;

&lt;p&gt;All cubes are decagons.&lt;/p&gt;

&lt;p&gt;No diagonal is a cube.&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;Conclusions:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;I. Some diagonals are polygons.&lt;/p&gt;

&lt;p&gt;II. All diagonals are decagons.&lt;/p&gt;

&lt;p&gt;III. No polygon is a cone.&lt;/p&gt;

&lt;p&gt;IV. Some cubes are angles.&lt;/p&gt;

hn.value:
&lt;p&gt;दिए गए कथनों और निष्कर्षों को ध्यानपूर्वक पढ़िए। यह मानते हुए कि कथनों में दी गई सूचना सत्य है, भले ही वह सामान्य रूप से ज्ञात तथ्यों से भिन्न प्रतीत होती हो, यह तय कीजिए&amp;nbsp;कि दिए गए निष्कर्षों में से कौन सा निष्&amp;zwj;कर्ष दिए गए कथनों का तार्किक रूप से अनुसरण करता है/करते हैं।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;कथन:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;सभी बहुभुज कोण हैं।&lt;/p&gt;

&lt;p&gt;सभी कोण विकर्ण हैं।&lt;/p&gt;

&lt;p&gt;सभी शंकु घन हैं।&lt;/p&gt;

&lt;p&gt;सभी घन दसभुज&amp;nbsp;हैं।&lt;/p&gt;

&lt;p&gt;कोई विकर्ण घन नहीं है।&lt;/p&gt;

&lt;p&gt;&lt;strong&gt;निष्कर्ष:&lt;/strong&gt;&lt;/p&gt;

&lt;p&gt;I. कुछ विकर्ण बहुभुज हैं।&lt;/p&gt;

&lt;p&gt;II. सभी विकर्ण दसभुज&amp;nbsp;हैं।&lt;/p&gt;

&lt;p&gt;III. कोई बहुभुज शंकु नहीं है।&lt;/p&gt;

&lt;p&gt;IV.&amp;nbsp;कुछ घन कोण हैं।&lt;/p&gt;

